import React from 'react';
import Agenda from './componente/Agenda';
import logo from './logo.svg';
function App() {
  return (
    <div className="App">
       <img src={logo} className="App-logo" alt="logo" />
      <header className="App-header">
       <Agenda/>
      </header>
    </div>
  );
}

export default App;
